import Home from "../../pages/Home";
import Login from "../../pages/Login";
import MyInfo from "../../pages/MyInfo";

export interface RouterItem {
  path: string;
  element: string;
  isLoggedIn: boolean;
  label: string;
}

const RouterInfo: RouterItem[] = [
  {
    path: "/",
    element: "Home",
    isLoggedIn: false,
    label: "홈",
  },
  {
    path: "/login",
    element: "Login",
    isLoggedIn: false,
    label: "로그인",
  },
  {
    path: "/my",
    element: "MyInfo",
    isLoggedIn: true,
    label: "내 정보",
  },
];

Object.freeze(RouterInfo);

export default RouterInfo;
